import React from "react";
import Props from "./props";
import Api from "./api";

let App = () => {
  return (

    <div className="container my-5">
      <div className="row">
        {Api.map((values)=>{
          return(
            <>
            <Props
            key={values.id}
              img={values.img}
              title={values.title}
            />
          </>
          )
        })}

      </div>
    </div>

  )
};
export default App;
